css:
.editor-colors {
  background-color: #212121;
  color: #d9d9d9;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #424242;
}
.editor .gutter {
  background-color: #212121;
  color: #424242;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #424242;
}
.editor .cursor {
  border-color: #20bbfc;
  border-width: 3px;
}
.editor .selection .region {
  background-color: #424242;
}
.editor .line-number.cursor-line-no-selection {
  color: #20bbfc;
}
.bracket-matcher {
  background-color: #262626;
}
.comment {
  color: #767676;
  font-style: italic;
}
.entity {
  color: #b6d6fd;
}
.keyword {
  color: #5fd7a7;
}
.storage.type {
  color: #6855de;
}
.constant {
  color: #b6d6fd;
}
.constant.numeric,
.constant.boolean {

}@blue _lighter;
.variable {
  color: #e32791;
}
.delimiter,
.brace,
.delimiter.period,
.punctuation.definition {
  color: #fb007a;
}
.invalid.deprecated {
  text-decoration: underline;
}
.invalid.illegal {
  background-color: #e32791;
  color: #ffffff;
}
.string {
  color: #4fb8cc;
}
